import request from '@/utils/request';
export default {
  count: function count() {
    return request({
      url: '/user/cart/count',
      method: 'get'
    });
  },
  queryByUser: function queryByUser() {
    return request({
      url: '/user/cart/queryByUser',
      method: 'get'
    });
  },
  add: function add(params) {
    return request({
      url: '/user/cart/add',
      method: 'POST',
      data: params
    });
  },
  update: function update(id, count) {
    return request({
      url: '/user/cart/update/' + id + '/' + count,
      method: 'POST'
    });
  },
  remove: function remove(params) {
    return request({
      url: '/user/cart',
      method: 'DELETE',
      data: params
    });
  }
};
